import react from 'react'

//import layout
import ContentFragment from '../layouts/ContentFragment'
import cx from 'classnames'

//React Reveal Animation
import Fade from 'react-reveal/Fade';

const ItemRace = (props) => {
    const item = props.data
    return (
        <react.Fragment>
            <ContentFragment title={item.title}
                time={item.time} text={item.intro}>

                {/* Photos */}
                <div className="row">
                    <Fade bottom distance='20px'></Fade>
                    <div className={cx("rowPhotoLandscape", "intro1")}></div>
                    <div className={cx("rowPhotoPortrait", "intro2")}></div>
                    <div className={cx("rowPhotoPortrait", "intro3")}></div>
                </div>
            </ContentFragment>

            <ContentFragment subtitle="Main Development"
                text={item.main1}>

                {/* Photos */}
                <div className="row">
                    <div className={cx("rowPhotoPortrait", "main2")}></div>
                    <div className={cx("rowPhotoPortrait", "main2")}></div>
                    <div className={cx("rowPhotoPortrait", "main2")}></div>
                    <div className={cx("rowPhotoPortrait", "main2")}></div>
                </div>
            </ContentFragment>

            <ContentFragment subtitle="Technology"
                text={item.main2}>

                {/* Photos */}
                <div className="row">
                    <div className={cx("rowPhotoPortrait", "main2")}></div>
                    <div className={cx("rowPhotoPortrait", "main2")}></div>
                    <div className={cx("rowPhotoPortrait", "main2")}></div>
                    <div className={cx("rowPhotoPortrait", "main2")}></div>
                </div>
                <div className="row">
                    <div className={cx("rowPhotoPortrait", "main2")}></div>
                    <div className={cx("rowPhotoPortrait", "main2")}></div>
                    <div className={cx("rowPhotoPortrait", "main2")}></div>
                    <div className={cx("rowPhotoPortrait", "main2")}></div>
                </div>
            </ContentFragment>

            <ContentFragment subtitle="Results"
                text={item.closure}>

                {/* Photos */}
                <div className="row">
                    <div className={cx("rowPhotoLandscape", "main1")}></div>
                    <div className={cx("rowPhotoPortrait", "main2")}></div>
                    <div className={cx("rowPhotoPortrait", "main2")}></div>
                </div>
            </ContentFragment>

            <ContentFragment subtitle="Placement Text"
                text={item.main1}>
                {/* No Photos */}
            </ContentFragment>
            <ContentFragment subtitle="Placement Text"
                text={item.main1}>
                {/* No Photos */}
            </ContentFragment>
            <style jsx>{`
                .intro1 {
                    background-image: url('/static/images/fitness/achievements/races/first.jpg');
                }

                .intro2 {
                    background-image: url('/static/images/fitness/achievements/races/finish2.jpg');
                }

                .intro3 {
                    background-image: url('/static/images/fitness/achievements/races/finish3.jpg');
                }

                .main1 {
                    background-image: url('/static/images/fitness/achievements/races/main1.png');
                }

                .main2 {
                    background-image: url('/static/images/fitness/achievements/races/main2.png');
                }

            `}</style>
        </react.Fragment >
    )
}

export default ItemRace;
